import React from "react";
import logo from "./logo.svg";
import "./App.css";
import FeatureItem from "./FeatureItem/FeatureItem.js";

function App() {
  const handleQuoteChange = symbol => {};
  return (
    <div className="App">
      <header className="App-header">
        <FeatureItem
          key="stock.symbol"
          stock="stock"
          color="color"
          handleQuoteChange={handleQuoteChange}
        />
      </header>
    </div>
  );
}

export default App;
